import React from 'react';

const UserData = ({ fullName, amount }) => {
  return (
    <div>
      <h1>User Data</h1>
      <h2>{`Name: ${fullName} and Received amount: ${amount}`}</h2> {/* Concatenate full name and amount */}
    </div>
  );
};

export default UserData;
